package org.table;

public class VisaDTO {

	private String jobseeker;
	private String name;
	private String bday;
	private String bmon;
	private String byear;
	private String passport;
	private String eday;
	private String emon;
	private String eyear;
	private String address1;
	private String address2;
	private String address3;
	private String mobile;
	private String maritalstatus;
	
	
	
	
	public VisaDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	
	
	
	public VisaDTO(String jobseeker, String name, String bday, String bmon,
			String byear, String passport, String eday, String emon,
			String eyear, String address1, String address2, String address3,
			String mobile, String maritalstatus) {
		super();
		this.jobseeker = jobseeker;
		this.name = name;
		this.bday = bday;
		this.bmon = bmon;
		this.byear = byear;
		this.passport = passport;
		this.eday = eday;
		this.emon = emon;
		this.eyear = eyear;
		this.address1 = address1;
		this.address2 = address2;
		this.address3 = address3;
		this.mobile = mobile;
		this.maritalstatus = maritalstatus;
	}




	public String getJobseeker() {
		return jobseeker;
	}
	public void setJobseeker(String jobseeker) {
		this.jobseeker = jobseeker;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getBday() {
		return bday;
	}
	public void setBday(String bday) {
		this.bday = bday;
	}
	public String getBmon() {
		return bmon;
	}
	public void setBmon(String bmon) {
		this.bmon = bmon;
	}
	public String getByear() {
		return byear;
	}
	public void setByear(String byear) {
		this.byear = byear;
	}
	public String getPassport() {
		return passport;
	}
	public void setPassport(String passport) {
		this.passport = passport;
	}
	public String getEday() {
		return eday;
	}
	public void setEday(String eday) {
		this.eday = eday;
	}
	public String getEmon() {
		return emon;
	}
	public void setEmon(String emon) {
		this.emon = emon;
	}
	public String getEyear() {
		return eyear;
	}
	public void setEyear(String eyear) {
		this.eyear = eyear;
	}
	public String getAddress1() {
		return address1;
	}
	public void setAddress1(String address1) {
		this.address1 = address1;
	}
	public String getAddress2() {
		return address2;
	}
	public void setAddress2(String address2) {
		this.address2 = address2;
	}
	public String getAddress3() {
		return address3;
	}
	public void setAddress3(String address3) {
		this.address3 = address3;
	}
	public String getMobile() {
		return mobile;
	}
	public void setMobile(String mobile) {
		this.mobile = mobile;
	}
	public String getMaritalstatus() {
		return maritalstatus;
	}
	public void setMaritalstatus(String maritalstatus) {
		this.maritalstatus = maritalstatus;
	}
	
	
	
	
	
}
